import React, { useState } from 'react';
import './LoginPage.module.css';
import logo from '../../assets/images/logo.jpg'
import loginImage from '../../assets/images/loginImage.jpg'

function LoginPage() {
  const [email, setEmail] = useState('');
  const [password, setPassword] = useState('');

  const handleSubmit = (e) => {
    e.preventDefault();
    // Implement login logic here
    console.log('Logging in with:', email, password);
  };

  return (
    <div className="fullPage" id='fullPage'>
      <div id="brandingWrapper" className="float">
        <div id="branding" className="illustrationClass"></div>
      </div>
      <div id='contentWrapper' className='float'>
        <div id="content">
          <div id="header">
            <img className='logoImage' id='companyLogo' src={logo}/>
          </div>
          <div id="workArea">
            <div id="authArea" className='groupMargin'>
              <div id="loginArea">
                <div id="loginMessage" className='groupMargin'>
                  <b>Login in the format:</b>
                  <br />
                  <b>DTU Users:</b>
                  " username@dtu.dk"
                  <br />
                  <b>DTU Students:</b>
                  " username@dtu.dk"
                  <br />
                  <b>Guest.dtu.dk Users:</b>
                  " username.win.dtu.dk"
                </div>

              </div>
            </div>
          </div>
        </div>
      </div>


      <h2>Login</h2>
      <form onSubmit={handleSubmit}>
        <input
          type="email"
          placeholder="Email"
          value={email}
          onChange={(e) => setEmail(e.target.value)}
          required
        />
        <input
          type="password"
          placeholder="Password"
          value={password}
          onChange={(e) => setPassword(e.target.value)}
          required
        />
        <button type="submit">Login</button>
      </form>
    </div>
  );
}

export default LoginPage;
